import React from "react"

export default function Rules(){
    return(
        <div>
            <h1 id="game-heading">Tenzi</h1>
            <div id="game-rules"><span>Roll until all dice are the same. Click each die to freeze it at its current value between rolls.
            Try to get the fastest time!</span></div>
        </div>
    )
}
